ADOBE PHOTOSHOP CS5 TRAINING DVD FOR WINDOWS &amp; MAC (Exercise files included)

CreativeTechs Complete 10-Week Photoshop Course.

A collection of video tutorials from Creativetechs. There are eleven classes in all, including the bonus lesson on colour correction. Each class runs for about an hour, and afterwards you can view the Q&amp;A sessions that took place after each weeks class. For Beginners to Advanced. Almost all the Photoshop aspects are covered, from the Basics to Retouching and Colour Correction, this is one of the more comprehensive and easy-to-learn tutorials in the market today. Each course is accompanied with an eBook.

Contains:

Week 1 Photoshop Basics
Week 2 Layers
Week 3 Selection Basics
Week 4 Advanced Selections
Week 5 Layer Masks
Week 6 Pen Tool and Shape Layers
Week 7 Drawing Tools and Brushes
Week 8 Retouching
Week 9 Colour Correction Part 1
Week 10 Colour Correction Part 2
Bonus Video Colour Calibration Theory

